import { Component } from "react"
import './accountdetails.css'

class AccountDetails extends Component{
    render(){
        return(
            <>
            <div className="accountdetails">
                <p className="accountdetailline">Username: <label></label></p>
                <p className="accountdetailline">Ratings: <label></label></p>
                <p className="accountdetailline">Account Created:<label></label></p>
            </div>
            </>
        )
    }
}

export default AccountDetails;
